byte[] seed;
if (this.seed == null) {
	seed = new byte[1];
	rnd.nextBytes(seed);
}
else {
	InputStream inputStream = this.seed.getInputStream();
	seed = FileCopyUtils.copyToByteArray(inputStream);
}
rnd.setSeed(seed);

