}
rnd.setSeed(seed);

if (seed == null) {
	rnd.nextBytes(new byte[1]);
}
else {
	InputStream inputStream = seed.getInputStream();
	byte[] bytes = FileCopyUtils.copyToByteArray(inputStream);
	rnd.setSeed(bytes);
}

